<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8">
  <meta content="#efefef" name="theme-color">
  <meta content="IE=edge" http-equiv="X-UA-Compatible">
  <meta content="width=device-width,initial-scale=1.0" name="viewport">
  <title></title>
  <!--@formatter:off-->
  <!--suppress CssUnusedSymbol -->
  <style>body{background-color:#f1f1f1}body.dark{background-color:#2b2b2b}</style>
  <!--@formatter:on-->
  <link href="" rel="icon">
</head>
<body>
<noscript>
  <strong>
    We're sorry but this application doesn't work properly without JavaScript enabled. Please enable it to continue.
  </strong>
</noscript>
<div id="app"></div>
<!--@formatter:off-->
<script>(function(){const isDark=localStorage.getItem('dark');const isZen=localStorage.getItem('zen');const themeColor=isDark?(isZen?'#2b2b2b':'#3b3b3b'):(isZen?'#efefef':'#ffffff');document.querySelector('meta[name=theme-color]').setAttribute('content',themeColor);const classList=document.body.classList;if(isDark){classList.add('dark')}else{classList.remove('dark')}if(isZen){classList.add('zen')}else{classList.remove('zen')}})()</script>
<!--@formatter:on-->
<!--suppress HtmlUnknownTarget -->
<script src="<%= BASE_URL %>assets/config.js"></script>
<!-- built files will be auto injected -->
</body>
</html>
